import React from "react";

const SignInUserOrRider = () => {
    return(
        <div  className="option-div">
            <p className="options">Sign In as a User</p>
            <p className="options">Or</p>
            <p className="options">Sign In as a Runner</p>
        </div>
    )
}

export default SignInUserOrRider;
